features.script:
let Door = feature;
let OpenAn = Door.createAnimation('position');
let CloseAn = Door.createAnimation('position');

OpenAn.setKeys([{
  frame: 60,
  value:  Door.position.add( new Vector3(2.3,0,0) )
}])

CloseAn.setKeys([{
  frame: 60,
  value:  Door.position.add( new Vector3(-0.02,0,0) )
}])

feature.on('trigger',e=>{
  //your code here
  //开门
  Door.position.set(-0.1,2.05,4.92);
  Door.startAnimations([OpenAn])

  //关门
    setTimeout(function(){
      Door.position.set(2.2,2.05,4.92);
      Door.startAnimations([CloseAn]);

      //复位  
      setTimeout(function(){
        Door.position.set(-0.1,2.05,4.92);
    }, 2000 )  
  }, 5000 )
})
